import React, { useEffect, useState } from 'react'
import { Link, useParams } from 'react-router-dom'
import '../styles/Routine.css'

const Routine = ({API_URL}) => {
  const params = useParams()
  const [routine, setRoutine] = useState({})
  const [sessionsRoutines, setSessionsRoutines] = useState([])

  useEffect(() => {
    const getRoutine = async () => {
      await fetch(`${API_URL}/routines`)
      .then(res => res.json())
      .then(data => {
        data.map(r => {
          if(r.id == params.id) {
            setRoutine(r)
          }
        })
      })
    }

    const getExercisesSession = async () => {
      fetch(`${API_URL}/sessionsRoutines/${params.id}`)
      .then(res => res.json())
      .then(data => setSessionsRoutines(data))
    }

    getRoutine()
    getExercisesSession()
  }, [API_URL, params.id])

  return (
    <div className='routine-container'>
      <h1>{routine.name}</h1>
      <table className='session-detail'>
        <thead>
          <tr>
            <th className='routine-detail'>Lunes</th>
            <th className='routine-detail'>Martes</th>
            <th className='routine-detail'>Miércoles</th>
            <th className='routine-detail'>Jueves</th>
            <th className='routine-detail'>Viernes</th>
            <th className='routine-detail'>Sábado</th>
            <th className='routine-detail'>Domingo</th>
          </tr>
        </thead>
        <tbody>
          <tr>

          </tr>
        </tbody>
      </table>
    </div>
  )
}

export default Routine
